import React from 'react';
import logo from './logo.svg';
import './App.css';
import { Login } from './pages/Login';
import { BrowserRouter,Switch,Route } from 'react-router-dom';
import { Routes } from './router/Routes';

function App() {
  return (
    <BrowserRouter>
      <div className="App">
      <Switch>
        <Route exact path="/">
            <Login />
        </Route>
        <Route path="/Home">
            <Home />
        </Route>
        <Route path="/Chart">
            <Chart />
        </Route>

    </Switch>
          </div>
    </BrowserRouter>
  );
}

export default App;
